import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Welcome to Student Portal</h2>
      <Link to="/student" data-testid="student-btn" style={styles.button}>
        All Student
      </Link>
    </div>
  );
};

export default Home;

const styles = {
  container: {
    textAlign: "center",
    margin: "50px auto",
  },
  heading: {
    fontSize: "24px",
    marginBottom: "20px",
  },
  button: {
    display: "inline-block",
    padding: "10px 20px",
    backgroundColor: "#007bff",
    color: "#fff",
    textDecoration: "none",
    borderRadius: "4px",
    fontSize: "16px",
  },
};
